// Gallery.js

import React from 'react';
import Visit from '../Image/visit.png'

const Gallery = () => {
  const images = [
    { id: 1, src: Visit, alt: 'Image 1' },
    { id: 2, src: Visit, alt: 'Image 2' },
    { id: 3, src: Visit, alt: 'Image 3' },
    { id: 1, src: Visit, alt: 'Image 1' },
    { id: 2, src: Visit, alt: 'Image 2' },
    { id: 3, src: Visit, alt: 'Image 3' },
    // Add more images as needed
  ];

  return (
    <div className="grid grid-cols-1 h-full pt-24 px-5 md:grid-cols-2 lg:grid-cols-3 gap-4">
      {images.map(image => (
        <div key={image.id} className="overflow-hidden m-1 rounded-lg shadow-md">
          <img src={image.src} alt={image.alt} className="w-full h-auto" />
        </div>
      ))}
    </div>
  );
};

export default Gallery;
